export default function getListStudents() {
  const arr = [];
  const studentOne = { id: 1, firstName: 'Guillaume', location: 'San Francisco' };
  const studentTwo = { id: 2, firstName: 'James', location: 'Columbia' };
  const studentFive = { id: 5, firstName: 'Serena', location: 'San Francisco' };

  arr.push(studentOne, studentTwo, studentFive);

  return arr;
}
